(function(){var a,d,c,b;d=require("webpage").create();c=require("system");if(c.args.length===1){console.log("Usage: loadspeed.coffee <some URL>");phantom.exit(1)}else{b=Date.now();a=c.args[1];d.open(a,function(e){if(e!=="success"){console.log("FAIL to load the address")}else{b=Date.now()-b;console.log("Page title is "+d.evaluate((function(){return document.title})));console.log("Loading time "+b+" msec")}return phantom.exit()})}}).call(this);